import React from 'react';
import { FaPlusSquare } from 'react-icons/fa';
const form = () => {
	const HandlerInput = e => {
		console.log(e);
	};

	return (
		<>
			<div className="input_parent">
				<input onChange={e => HandlerInput()} type="text" className="input_todo"></input>
				{/* <div className="todo_plus"></div> */}

				<FaPlusSquare className="plus" onClick={e => e.preventDefault} />
			</div>
		</>
	);
};

export default form;
